const image1 = new Image();

for (i = 0; i < 1; i++) {


    image1.src = 'data:image/png;base64,'
};


image1.addEventListener('load', function() {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 1130;
    canvas.height = 800;
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);


    let particalsArray = [];
    const numberOfParticals = 5000;

    class partical {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 3.5;
            this.size = Math.random() * 1.5 + 1;
        }
        update() {
            this.y += this.velocity;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticals; i++) {
            particalsArray.push(new partical);
        }
    }
    init();

    function animate() {
        ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        for (i = 0; i < particalsArray.length; i++) {
            particalsArray[i].update();
            particalsArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

})